function Product() {
  return (
    <div className="flex basis-1/5">
      <img src="/frontend/public/images/gadgets-images.jpg" alt="" />
      <div>
        <a href="!#">Name</a>
      </div>
      <div>3999</div>
      <div>
        <button>BUY</button>
      </div>
    </div>
  );
}

export default Product;
